import { useState } from "react";

const Apps = () => {
  const [user, setUser] = useState([]);

  const handleChange = (e) => {
    setUser(e.target.value);
  };

  return (
    <div sty>
      <form>
        <h1>This is app</h1>
        <input type="text" value={user} onChange={handleChange} />
        <button>Add User</button>
      </form>
    </div>
  );
};
export default Apps;
